import React from "react";
import PostCardStyleHome from "./Cards/PostCardStyleHome";

function NewsGrid({
  technologyNewsData,
  dataLength = "4",
  gridClasses = "col-lg-3 col-md-6",
}) {
  return (
    <div className="row g-0">
      
      <div key={technologyNewsData.category_id} className={gridClasses}>
        <PostCardStyleHome
          datas={{
            image: technologyNewsData.image,
            category: "Technology",
            date: technologyNewsData.date,
            title: technologyNewsData.title,
            user: technologyNewsData.user,
          }}
        />
      </div>
    </div>
  );
}

export default NewsGrid;
